import React from "react"
import "./style.css"

class Project extends React.Component {

  render() {
    return (
      <div className="projectPage">
        <a href="#">&#8592; BACK</a>
        <div className="projectImage">
          <img src="./techExp.jpg" alt="computer" />
        </div>
      </div>

    )
  }
}

export default Project
